import React from 'react'
import Manifest from './manifest.json'

const TextBlocks = () => {
    var text = Manifest.main
    return(
    <div className='space-y-5'>
        {text.split('/n').map((i,key) => {
            return <div key={key}>{i}</div>;
            })}
        </div>
    )
}

const SectionContent = () => { 
    return (
    <div className='flex flex-col text-black p-7'>
        <div className='font-bold text-sm opacity-70'>{Manifest.heading}</div>
        <div className='font-extrabold text-2xl'>"{Manifest.title}"</div>
        <div className='font-extrabold text-base'>- {Manifest.author}</div>
        <div className='font-medium text-base leading-snug'>
            <TextBlocks />
        </div>
    </div>
    )
}

export default SectionContent
